import React from 'react';
import TeamMemberCard from './TeamMemberCard';


const Team = ({ TeamData }) => {
  return (
    <div className="team">
      {TeamData.map((member, index) => (
        <TeamMemberCard
          key={index}
          name={member.name}
          role={member.role}
          photo={member.photo}
          bio={member.bio}
        />
      ))}
    </div>
  );
};

export default Team;
